class Solution {

    /**
     * @param String[] $words
     * @return Integer
     */
    function maxProduct($words) {
        $data = [];
        $max = 0;
        $count = count($words);
        for ($i=0; $i < $count; $i++) $data[] = ['data' => array_unique(str_split($words[$i])), 'len' => strlen($words[$i])];
        for ($i=0; $i < $count; $i++) for ($j=$i + 1; $j < $count; $j++) if (count(array_intersect($data[$i]['data'], $data[$j]['data'])) == 0) $max = max([$max, $data[$i]['len'] * $data[$j]['len']]);
        return $max;
    }
}

